import './App.css';

//const title ='fares';
const welcome = {
greeting : "Hey",
title :"react"
};

const list = [
{
  title : 'react',
  url:'https://reactjs.org/',
  author :'Jordan Walke',
  num_comments : 3,
  points : 4,
  objectID : 0
},
{
  title : 'Redux',
  url:'https://redux.js.org/',
  author :'Dan Abramov, Andrew Clark',
  num_comments : 2,
  points : 5,
  objectID : 1
}
];
function getTitle (title){
  return title;
}
function App() {
  return (
    <div className="App">
      <h1>{welcome.greeting} {welcome.title}</h1>
      <h1>{getTitle("test title")}</h1>
      <label htmlFor='search'> Search :</label>
      <input id="search" type="text"/>

      <ul>
        {list.map(function (item){
          return <h2><li>{item.title}</li></h2> ;
        })}
      </ul>
    </div>
  );
}



export default App;
